import './App.css';
import AppContent from './AppContent';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
        <div className="row justify-content-center mt-5">
          <div className="col-lg-6 col-md-8 col-sm-12">

            <AppContent />
            <div className="container">
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
